                    {% if field.vars.name != '_token' %}
                        <div class=\"mb-3\">
                            {{ form_label(field) }}
                            {{ form_widget(field, {'attr': {'class': 'form-control'}}) }}
                            {{ form_errors(field) }}
                        </div>
                    {% endif %}
                {% endfor %}
            </div>
            <div class=\"card-footer\">
                <button type=\"submit\" class=\"btn btn-success\">Enregistrer</button>
                <a href=\"{{ path('app_admin_dashboard') }}\" class=\"btn btn-secondary\">Annuler</a>
                {{ form_end(form) }}
            </div>
        </div>
    </div>
{% endblock %}
